import React, {
  Component
} from 'react';
import {
  View,
  Text,
  AppRegistry
} from 'react-native';
import Style from './Style';
class ReactCalculator extends Component {
  render() {
    return ( <
      View style = {
        Style.rootContainer
      } >
      <
      View style = {
        Style.displayContainer
      } > < /View> <
      View style = {
        Style.inputContainer
      } > < /View> <
      /View>
    );
  }
}

export default ReactCalculator
